import { useParams } from 'react-router-dom';

export default function EndLessonStep(props) {
    const { step } = useParams();
    isDone;

    const history = useHistory()
    const handleClick = () => {
        isDone = 1;
        history.push('/' + step);
    }
    return (
        <Button onClick={handleClick}
        >congradulations</Button>
